import React from 'react';
import styled from 'styled-components';
const StyledBar = styled.div`
        height: ${({ height }) => `${height}px`};
        width: '20px';
        backgroundColor: 'teal';
        display: 'inline-block';
        margin: '0 2px';
`;
const Bar = ({height}) => {
    return <styledBar height = {height} />;
};

export default Bar;
